import React from 'react';
import burgerLogo from '../../../../../assets/images/burger-logo.png';
import styles from './Menu.module.css';  

const menu = (props) => (

    <div className={styles.Menu}> 
        <img  src={burgerLogo}  onClick={props.open}>  </img>
    </div>
    
);



export default menu;
